// SPDX-License-Identifier: MIT
pragma solidity ^0.7.4;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@chainlink/contracts/src/v0.7/VRFConsumerBase.sol";
import "../library/Governance.sol";
import "../interface/INftAsset.sol";
import "./SantaV2.sol";

contract SantaFactoryV3 is Governance, VRFConsumerBase, IERC721Receiver {
    using Address for address;
    using SafeMath for uint256;
    struct SantaV2Data {
        address santa;
        uint256 id;
        uint256 face_value;
        uint256 createdTime;
    }
    struct SantaContractData {
        ERC20 acceptedToken;
        uint256 maxCount;
        address santa;
    }
    event SantaV2NFTAdded(
        address santa,
        uint256 indexed id,
        address author,
        uint256 face_value
    );
    event SantaV2Created(
        string name,
        string symbol,
        address acceptedToken,
        address santa,
        uint256 maxCount
    );

    mapping(address => uint256) public _lastMintedNFTId;
    mapping(address => address) public _lastMintedNFTSantaAddress;
    mapping(address => bool) public _mintingStatus;

    mapping(string => SantaContractData) _nameToContractData;
    string[] public _names;
    mapping(address => SantaContractData) _addressToContractData;
    mapping(address => mapping(uint256 => SantaV2Data)) public _santas;
    ERC20 _cifiTokenContract = ERC20(0x0);

    address public _feeAccount = address(0x0000000000000000000000);
    uint256 public _feeAmount = 0;

    uint256 _linkFee = 0;
    bytes32 _linkKeyHash = bytes32("");
    mapping(bytes32 => address) public requestIdToMinter;
    mapping(bytes32 => address) public requestIdToSanta;
    mapping(bytes32 => uint256) public requestIdToFaceValue;

    constructor(
        address cifi,
        address vrfCoordinator,
        address linkToken,
        bytes32 linkKeyHash,
        uint256 linkFee
    ) VRFConsumerBase(vrfCoordinator, linkToken) {
        _cifiTokenContract = ERC20(cifi);
        _feeAccount = msg.sender;
        _feeAmount = 1 * (10**18);
        _linkFee = linkFee;
        _linkKeyHash = linkKeyHash;
    }

    function createSanta(
        string memory name,
        string memory symbol,
        string memory baseURI,
        address acceptedToken,
        uint256 maxNftCount
    ) public onlyGovernance returns (address) {
        require(
            _nameToContractData[name].santa == address(0),
            "The name was already used"
        );
        SantaV2 santa = new SantaV2(name, symbol, baseURI);
        SantaContractData memory contractData;
        contractData.acceptedToken = ERC20(acceptedToken);
        contractData.maxCount = maxNftCount;
        contractData.santa = address(santa);
        _nameToContractData[name] = contractData;
        _addressToContractData[address(santa)] = contractData;
        _names.push(name);
        emit SantaV2Created(
            name,
            symbol,
            acceptedToken,
            address(santa),
            maxNftCount
        );
        return address(santa);
    }

    function getLastMintedNFTId()
    public view returns (uint256)
    {
        return _lastMintedNFTId[msg.sender];
    }

    function getLastMintedNFTSantaAddress()
    public view returns (address)
    {
        return _lastMintedNFTSantaAddress[msg.sender];
    }

    function getContractCount() public view returns (uint256) {
        return _names.length;
    }

    function getContractNames(uint256 id) public view returns (string memory) {
        return _names[id];
    }

    function getContractData(string memory name)
        public
        view
        returns (
            address acceptedToken,
            uint256 maxCount,
            address santa
        )
    {
        SantaContractData memory contractData = _nameToContractData[name];
        require(
            contractData.santa != address(0),
            "SantaFactoryV3: Invalid name"
        );
        acceptedToken = address(contractData.acceptedToken);
        maxCount = contractData.maxCount;
        santa = contractData.santa;
    }

    function getFaceValue(address santa, uint256 tokenId)
        public
        view
        returns (uint256)
    {
        SantaV2Data memory santa_data = _santas[santa][tokenId];
        return santa_data.face_value;
    }

    function setMintingStatus(bool statusValue)
    public
    returns (bool)
    {
        _mintingStatus[msg.sender] = statusValue;
        return statusValue;
    }

    function getMintingStatus()
    public 
    view
    returns (bool)
    {
        return _mintingStatus[msg.sender];
    }

    /**
     * @dev set cifi contract address
     */
    function setCifiContract(address cifi) public onlyGovernance {
        _cifiTokenContract = ERC20(cifi);
    }

    function ChangeFeeAccount(address newFeeAccount)
        public
        onlyGovernance
        returns (bool)
    {
        _feeAccount = newFeeAccount;
        return true;
    }

    function ChangeFeeAmount(uint256 newFeeAmount)
        public
        onlyGovernance
        returns (bool)
    {
        _feeAmount = newFeeAmount;
        return true;
    }

    function mint(address santa, uint256 face_value) public returns (bytes32) { // return uint256
        SantaContractData memory contractData = _addressToContractData[santa];
        require(
            face_value > 0,
            "SantaFactoryV3: face_value should be grater than 0!"
        );
        require(
            contractData.santa != address(0) && contractData.santa == santa,
            "SantaFactoryV3: Invalid Nft address"
        );
        require(
            contractData.acceptedToken.allowance(msg.sender, address(this)) >=
                face_value,
            "SantaFactory2V2: Allownce is less than face_value!"
        );

        require(
            contractData.acceptedToken.balanceOf(msg.sender) >= face_value,
            "SantaFactoryV3: Your balance is less than face value!"
        );

        require(
            LINK.balanceOf(address(this)) >= _linkFee,
            "SantaFactoryV3: Not enough LINK - fill contract with faucet"
        );
        require(
            SantaV2(santa).totalSupply() < contractData.maxCount,
            "SantaFactoryV3: Total tokens were already minted!"
        );
        _cifiTokenContract.transferFrom(msg.sender, _feeAccount, _feeAmount);
        contractData.acceptedToken.transferFrom(
            msg.sender,
            address(this),
            face_value
        );
        bytes32 requestId = requestRandomness(_linkKeyHash, _linkFee);
        _mintingStatus[msg.sender] = true;
        requestIdToMinter[requestId] = msg.sender;
        requestIdToSanta[requestId] = santa;
        requestIdToFaceValue[requestId] = face_value;        
        return requestId;

        // uint256 nftID = 1;
        // while (SantaV2(santa).exists(nftID)) {
        //     nftID = ((nftID + 1) % contractData.maxCount) + 1;
        // }

        // SantaV2(santa).mint(msg.sender, nftID);

        // SantaV2Data memory santa_data;
        // santa_data.santa = santa;
        // santa_data.id = nftID;
        // santa_data.face_value = face_value;
        // santa_data.createdTime = block.timestamp;
        // _santas[santa][nftID] = santa_data;

        // emit SantaV2NFTAdded(santa, nftID, msg.sender, face_value);

        // return nftID;
    }

    function fulfillRandomness(bytes32 requestId, uint256 randomness)
        internal
        override
    {
        address santa = requestIdToSanta[requestId];
        SantaContractData memory contractData = _addressToContractData[santa];
        require(
            SantaV2(santa).totalSupply() < contractData.maxCount,
            "Total tokens were already minted!"
        );
        address minter = requestIdToMinter[requestId];
        uint256 nftID = (randomness % contractData.maxCount) + 1;

        while (SantaV2(santa).exists(nftID)) {
            nftID = ((nftID + 1) % contractData.maxCount) + 1;
        }
        uint256 face_value = requestIdToFaceValue[requestId];

        SantaV2(santa).mint(minter, nftID);

        SantaV2Data memory santa_data;
        santa_data.santa = santa;
        santa_data.id = nftID;
        santa_data.face_value = face_value;
        santa_data.createdTime = block.timestamp;
        _santas[santa][nftID] = santa_data;
        

        _lastMintedNFTId[minter] = nftID;
        _lastMintedNFTSantaAddress[minter] = santa;
        _mintingStatus[minter] = false;
        emit SantaV2NFTAdded(santa, nftID, minter, face_value);
    }

    function retrieveToken(address santa, uint256 tokenId)
        external
        returns (bool)
    {
        require(santa != address(0), "SantaFactoryV2: ! 0 address");
        SantaV2Data memory santa_data = _santas[santa][tokenId];
        SantaContractData memory contractData = _addressToContractData[santa];
        require(santa_data.id > 0, "SantaFactoryV2: not exist");
        require(
            contractData.santa == santa,
            "SantaFactoryV2: Invalid Santa Address"
        );
        require(
            santa_data.santa == santa,
            "SantaFactoryV2: Invalid Santa Address"
        );
        require(
            SantaV2(santa).ownerOf(tokenId) == msg.sender,
            "SantaFactoryV2: Invalid owner"
        );
        if (santa_data.face_value >= 0) {
            contractData.acceptedToken.transfer(
                SantaV2(santa).ownerOf(tokenId),
                santa_data.face_value
            );
            santa_data.face_value = 0;
            _santas[santa][tokenId] = santa_data;
        }
        return true;
    }

    function burn(address santa, uint256 tokenId) external returns (bool) {
        SantaV2Data memory santa_data = _santas[santa][tokenId];
        SantaContractData memory contractData = _addressToContractData[santa];
        require(santa_data.id > 0, "not exist");

        SantaV2(santa).safeTransferFrom(msg.sender, address(this), tokenId);
        if (santa_data.face_value >= 0) {
            contractData.acceptedToken.transfer(
                SantaV2(santa).ownerOf(tokenId),
                santa_data.face_value
            );
        }

        SantaV2(santa).burn(tokenId);
        delete _santas[santa][tokenId];
        return true;
    }

    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }
}
